(1, NULL, 2, '2', NULL, 1, 3, 14, '20000.00', 2, 0, 0, 1, 0, 'null', 'null', 'Front End Developers must have a bachelor’s degree in computer science, computer engineering or a related field. Candidates must demonstrate proficiency in programming languages such as HTML, C#, JavaScript and SQL. Front End Developers should also have a thorough understanding of web design and SEO optimization. Most employers prefer applicants who have trained in cross-platform website design and keep themselves up to date on new website tools and languages as they enter the workforce.', 'Determining the structure and design of web pages.\nEnsuring user experience determines design choices.\nDeveloping features to enhance the user experience.\nStriking a balance between functional and aesthetic design.\nEnsuring web design is optimized for smartphones.', 'Need additional personnel for the operation department', '2021-12-28', '2', '2', '2021-12-28 08:58:27', '2021-12-28 08:58:27.0', 2, 2, '2021-12-28 08:58:27', '2021-12-28 00:58:28'),
(2, NULL, 2, '2', NULL, 1, 3, 5, '30000.00', 2, 0, 0, 1, 0, 'null', 'null', 'Degree in information technology, computer science, or related.\nExtensive knowledge of software development and its technologies.\nStrong knowledge of Javascript, C++, PHP, and SQL.\nSolid experience in coding.\nStrong knowledge of user interfaces.\nStrong knowledge of HTML and web frameworks.\n5 years working experience', 'Performing coding assignments.\nReviewing code work for accuracy and functionality.\nCreating and implementing design plans.\nAnalyzing code segments regularly.\nDelegating tasks to team members.\nKeeping up-to-date with industry trends and technology developments.', 'Need additional personnel', '2021-12-30', '4', '2', '2021-12-28 12:55:53', '2021-12-28 12:54:44.0', 2, 4, '2021-12-28 12:54:44', '2021-12-28 04:55:55'),
(3, NULL, 2, '0', NULL, 1, 3, 12, '0.00', 0, 0, 0, 0, 0, 'null', 'null', '', '', '', '2021-12-28', NULL, NULL, NULL, NULL, 2, 2, '2021-12-28 15:18:16', '2021-12-28 07:20:26');
