CREATE DEFINER=`root`@`%` PROCEDURE `proc_get_equipment_borrowing_approve` (IN `id` BIGINT(255))  BEGIN
DECLARE returnItemID INT DEFAULT NULL;

SELECT 
		employeeID, 				equipmentBorrowingID, 		equipmentBorrowingCode, inventoryValidationID,
        inventoryValidationCode,	materialRequestID, 			materialRequestCode, 	projectCode, 			
        projectName,				projectCategory, 			clientCode, 			clientName, 			
        clientAddress,				returnItemStatus,		'1' AS recordID,			dateNeeded
FROM	
(
SELECT 
		employeeID, 				equipmentBorrowingID, 	equipmentBorrowingCode,		inventoryValidationID, 
		inventoryValidationCode,	materialRequestID, 	 	materialRequestCode,		projectCode,
		projectName, 				projectCategory,		clientCode,					clientName,
        clientAddress,	 			'0' AS returnItemStatus, dateNeeded		
FROM ims_equipment_borrowing_tbl 
WHERE materialWithdrawalID =id AND equipmentBorrowingStatus = 9 
)w;

SET returnItemID  = LAST_INSERT_ID();

SELECT returnItemID, recordID, itemID, itemCode, Brand, itemName, classificationName, categoryName, quantity, borrowedDate, uom
FROM 
(
	SELECT 		'1' AS recordID, 				assetID AS itemID,
				assetCode AS itemCode, 			brand AS Brand, 
				assetName AS itemName, 			classificationName AS classificationName,
				categoryName AS categoryName, 	uom AS uom,
				quantity AS quantity,			stockOutDate as borrowedDate
				
	FROM ims_stock_in_assets_tbl AS ri
	LEFT JOIN ims_equipment_borrowing_tbl AS po ON ri.equipmentBorrowingID = po.equipmentBorrowingID
	WHERE po.materialWithdrawalID = id AND equipmentBorrowingStatus = 9 
)i;

END$$

CREATE DEFINER=`root`@`%` PROCEDURE `proc_get_material_withdrawal_approve` (IN `id` BIGINT(255))  BEGIN
DECLARE materialUsageID  INT DEFAULT NULL;

SELECT 
		employeeID, 				materialWithdrawalID, 		materialWithdrawalCode, inventoryValidationID,
        inventoryValidationCode,	materialRequestID, 			materialRequestCode, 	projectCode, 			
        projectName,				projectCategory, 			clientCode, 			clientName, 			
        clientAddress,				materialUsageDate,			materialUsageStatus,		'0' AS recordID
FROM	
(
SELECT 
		employeeID, 				mw.materialWithdrawalID, 	materialWithdrawalCode,		mw.inventoryValidationID, 
		mw.inventoryValidationCode,	mw.materialRequestID, 	 	materialRequestCode,		projectCode,
		projectName, 				projectCategory,			clientCode,					clientName,
        clientAddress,	 			dateNeeded AS materialUsageDate,					'O' AS materialUsageStatus		
FROM ims_material_withdrawal_tbl AS mw
LEFT JOIN ims_material_withdrawal_item_tbl AS mwi ON mw.materialWithdrawalID = mwi.materialWithdrawalID
WHERE mwi.materialWithdrawalID = id AND inventoryItemStatus = 9 
GROUP BY mw.materialWithdrawalID
)w GROUP BY materialWithdrawalID;

 SET materialUsageID  = LAST_INSERT_ID();
 


SELECT materialUsageID , recordID, itemID, itemCode, Brand, itemName, classificationName, categoryName, quantity, uom
FROM 
(
	SELECT '0' AS recordID, 				itemID,
			itemCode, 						itemBrandName AS Brand, 
			itemName, 						itemClassification AS classificationName,
			itemCategory AS categoryName, 	itemUom AS uom, 
			SUM(stockOut) AS quantity
	FROM ims_material_withdrawal_item_tbl AS ri
	LEFT JOIN ims_material_withdrawal_tbl AS po ON ri.materialWithdrawalID = po.materialWithdrawalID
	WHERE po.materialWithdrawalID = id AND ri.withdrawalItemStatus = 1 GROUP BY ri.itemID
)i;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `proc_get_purchase_order_approve` (IN `id` BIGINT(255))  BEGIN
DECLARE inventoryReceivingID INT DEFAULT NULL;

SELECT 
		employeeID, 		purchaseOrderID, 			purchaseOrderCode,
		timelineBuilderID, 	projectCode,	 			projectName,
		projectCategory, 	clientCode, 				clientName, 
		clientAddress,		inventoryReceivingStatus,   recordID
FROM
(
SELECT 
		employeeID, 		po.purchaseOrderID, purchaseOrderCode,	timelineBuilderID, 
		projectCode,		projectName, 	 projectCategory,	clientCode,
		clientName, 		clientAddress,	 'O' AS inventoryReceivingStatus,
		CASE  WHEN iri.purchaseOrderID  IS NOT NULL THEN 0
        ELSE 1 END  recordID
FROM ims_purchase_order_tbl AS po
LEFT JOIN ims_request_items_tbl AS  iri ON po.purchaseOrderID = iri.purchaseOrderID
LEFT JOIN ims_request_assets_tbl AS ira ON po.purchaseOrderID = ira.purchaseOrderID
WHERE po.purchaseOrderID =id AND purchaseOrderStatus = 2
)w GROUP BY purchaseOrderID;

 SET inventoryReceivingID = LAST_INSERT_ID();
 


SELECT inventoryReceivingID, recordID, itemID, itemCode, Brand, itemName, classificationName, categoryName, quantity, uom
FROM 
(
	SELECT '0' AS recordID, 				itemID,
			itemCode, 						itemBrandName AS Brand, 
			itemName, 						itemClassification AS classificationName,
			itemCategory AS categoryName, 	itemUom AS uom, 
            forPurchase AS quantity
	FROM ims_request_items_tbl AS ri
	LEFT JOIN ims_purchase_order_tbl AS po ON ri.purchaseOrderID = po.purchaseOrderID
	WHERE po.purchaseOrderID = id AND purchaseOrderStatus = 2
	UNION ALL
	SELECT '1' AS recordID, 				assetID AS itemID, 
			assetCode AS itemCode, 			assetBrandName AS Brand, 
			assetName AS itemName,			assetClassification AS classificationName,
			assetCategory AS categoryName,	assetUom AS uom,
            forPurchase AS quantity
	FROM ims_request_assets_tbl AS ra
	LEFT JOIN ims_purchase_order_tbl AS po ON ra.purchaseOrderID = po.purchaseOrderID
	WHERE ra.purchaseOrderID = id AND purchaseOrderStatus = 2
)a; 

END$$

CREATE DEFINER=`root`@`%` PROCEDURE `proc_get_receiving_report_remaining` (IN `id` BIGINT(255))  BEGIN
DECLARE inventoryReceivingID INT DEFAULT NULL;

 SELECT employeeID, 		purchaseOrderID, 			purchaseOrderCode,
		timelineBuilderID, 	projectCode,	 			projectName,
		projectCategory, 	clientCode, 				clientName, 
		clientAddress,		inventoryReceivingStatus,   recordID
FROM 
(
 SELECT
		employeeID, 		purchaseOrderID, 			purchaseOrderCode,
		timelineBuilderID, 	projectCode,	 			projectName,
		projectCategory, 	clientCode, 				clientName, 
		clientAddress,		0 AS inventoryReceivingStatus,   iir.recordID
FROM ims_inventory_receiving_tbl AS iir 
LEFT JOIN ims_inventory_request_details_tbl AS iird ON iir.inventoryReceivingID = iird.inventoryReceivingID
WHERE iir.inventoryReceivingID=id AND inventoryReceivingStatus = 2 AND iird.remainingQuantity <>0.00
)w GROUP BY purchaseOrderID;
 
SET inventoryReceivingID = LAST_INSERT_ID();
 
SELECT inventoryReceivingID, recordID, itemID, itemCode, Brand, itemName, classificationName,  quantity, uom
FROM 
(
	SELECT iir.recordID, itemID, itemCode, Brand, itemName, classificationName, remainingQuantity AS quantity, uom
	FROM ims_inventory_request_details_tbl AS iird
	LEFT JOIN ims_inventory_receiving_tbl AS iir ON iird.inventoryReceivingID = iir.inventoryReceivingID
	WHERE iird.inventoryReceivingID=id AND inventoryReceivingStatus = 2 AND remainingQuantity <>0.00
	GROUP BY iird.itemID
)i;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `proc_update_bid_po_items` (IN `iBidRecapID` BIGINT(21), IN `iInventoryVendorID` BIGINT(21), IN `documentStatus` INT(11))  BEGIN
	DECLARE itemStatus INT(11) DEFAULT 0;
    DECLARE primaryKey BIGINT(21);
    
    IF (documentStatus <> 3 AND documentStatus <> 4) THEN
		SET itemStatus = 1;
    ELSE 
		SET itemStatus = 0;
    END IF;

	IF (iBidRecapID <> 0 AND iInventoryVendorID <> 0) THEN
		SELECT bidPoID INTO primaryKey FROM ims_bid_po_tbl WHERE bidRecapID = iBidRecapID AND inventoryVendorID = iInventoryVendorID;
		UPDATE ims_bid_po_tbl SET bidPoStatus = itemStatus WHERE bidPoID = primaryKey;
    END IF;
END$$

